page_script({init:function(){$("#message_form").ajaxForm({beforeSubmit:function(){$(".success_msg",$("#message_form")).hide();$(".unhandled_error",$("#message_form")).hide()},success:function(a){try{parsed=JSON.parse(a);if(parsed.status=="success"){$(".success_msg",$("#message_form")).show();$("#message_form")[0].reset()}else{console.log(a);$(".unhandled_error",$("#message_form")).show()}}catch(b){console.log(a);$(".unhandled_error",$("#message_form")).show()}}});$("#message_modal").on("hide.bs.modal",function(){$("#message_form")[0].reset();$(".success_msg",$("#message_form")).hide();$(".unhandled_error",$("#message_form")).hide()});$(".map-canvas").each(function(){var b=new google.maps.LatLng($(this).attr("data-latitude"),$(this).attr("data-longitude"));var c={scrollwheel:false,zoom:13,center:b};var d=new google.maps.Map($(this)[0],c);var a=new google.maps.Marker({position:b});a.setMap(d)});window.fbAsyncInit()}});